package main

import "fmt"

func maxProduct(nums []int) int {
	var product  = nums[0]
	var dp = make([][2]int, len(nums),len(nums))
	for i:=0;i<len(nums);i++ {
		dp[i][0]  = nums[i]
		dp[i][1]  = nums[i]
		if nums[i] > product {
			product = nums[i]
		}
	}
	for i:=1;i<len(nums);i++ {
		if nums[i] > 0 {
				dp[i][0] = 	max(dp[i-1][0] * nums[i], nums[i])
				dp[i][1] = min(dp[i-1][1] * nums[i], nums[i])
		} else if nums[i] < 0 {
			dp[i][0] = 	max(dp[i-1][1] * nums[i], nums[i])
			dp[i][1] = min(dp[i-1][0] * nums[i], nums[i])
		}
		if dp[i][0] > product {
			product = dp[i][0]
		}
	}
	return product
}

func max(x,y int) int  {
	if x > y {
		return x
	}
	return y
}

func min(x,y int) int  {
	if x < y {
		return x
	}
	return y
}


